def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index

    rlocs = [i for i in range(index.nlevels) if i not in clocs]

    if isinstance(data.columns, MultiIndex):
        result = data
        for i in range(len(clocs)):
            val = clocs[i]
            result = result.unstack(val, fill_value=fill_value)
            clocs = [v if i > v else v - 1 for v in clocs]
        return result

    clevel_names = [index.names[i] for i in clocs]
    rlevel_names = [index.names[i] for i in rlocs]

    if rlocs == []:
        dummy_index = Index(range(len(index)), name="__placeholder__")
    else:
        dummy_index = MultiIndex(
            levels=[index] + [range(len(index))], 
            codes=[list(range(len(index))) + list(range(len(index)))], 
            names=[index.name, "__placeholder__"],
            verify_integrity=False,
        )

    dummy = data.copy()
    dummy.index = dummy_index

    unstacked = dummy.unstack("__placeholder__", fill_value=fill_value)
    if isinstance(unstacked, Series):
        unstcols = unstacked.index
    else:
        unstcols = unstacked.columns

    new_levels = [unstcols.levels[0]] + [index.levels[i] for i in clocs]
    new_names = [data.columns.name] + clevel_names

    new_codes = [unstcols.codes[0]]
    for level in clocs:
        new_codes.append(unstcols.codes[level - rlocs[0]])

    new_columns = MultiIndex(
        levels=new_levels, codes=new_codes, names=new_names, verify_integrity=False
    )

    if isinstance(unstacked, Series):
        unstacked.index = new_columns
    else:
        unstacked.columns = new_columns

    return unstacked
